import React, { Component } from 'react'
import Grid from '@material-ui/core/Grid';
import axios from 'axios';
class home extends Component {
    state = {
        lists: null
    }
    componentDidMount(){
        axios.get('/lists')
        .then(res =>{
            console.log(res.data);
            this.setState({
                lists: res.data
            })
        })
        .catch(err=>{
            console.error(err);
        })
    }
    render() {
        let recentListsMarkup = this.state.lists ? (
            this.state.lists.map(list => <p>{list.userHandle}</p>)
        ):(<p>Loading...</p>);
        return (
            <Grid container spacing={8}>
                <Grid item sm={4} xs={8}>
                    {recentListsMarkup}
                </Grid>
                <Grid item sm={2} xs={8}>
                    <p>hello</p>
                </Grid>
            </Grid> 
        );
    }
}

export default home
